That moment when the library and cozy nook go up! ✨ It feels like home and I’m so ready to share and grow this space with my classes. 

@nuggetcomfort is ready to cozy up your classroom space too with a Nugget during their “The More You Nugget” giveaway program for public school teachers!

All you have to do is enter/or nominate a K-5 teacher, and teachers must have a public school email. There isn’t a deadline on this one since it’s happening every 4-6 weeks! 👏🏼 Link in profile to enter.
